import Vue from 'vue';
import Vuex, { Store } from 'vuex';
import state from "./state";
import getters from "./getters";
import mutations from "./mutations";
import actions from "./actions";
Vue.use(Vuex);
var store = new Store({
  state: state,
  getters: getters,
  mutations: mutations,
  actions: actions
});
export default store;
